    //         console.log(empdata);
    //     })
    //     .catch(e => {
    //         console.log(e);
    //     });
    // }

    

    render() {
        return (
            <form action="" class="container">
                <div className="row" >
                    <div className="col-5" >
                        <ul className="list-group" type="none">
                            <li><input className="prop" type="text" name="username" id="username" placeholder="Username"></input> <button className="btn btn-primary">Search</button></li>
                        </ul>
                        
                        <ul className="list-group">
                                <li className="list-group-item">
                                <b> Employee Name </b>
                                </li>
                        </ul>
                    </div>
                    <div className="col" style=" background-color: white; padding: 2%;">
                        <div className="row">
                            <div className="col-3">
                                <img src="photo.jpg" alt=""></img>
                            </div>
                            <div className="col">
                                <h3>Shantanu Kukade</h3>
                                <h6>A1012</h6>
                                <h6>shantanu.kukade@agiliad.com</h6>
                                <h6>Storage group</h6>
                            </div>
                        </div>
                        <br/>
                        <div className="row" >
                            <div className="col-4">
                                <ul type="none">
                                    <li> <b> <h5> Skills </h5> </b> </li>
                                        <ul>
                                            <li>C++</li>
                                        </ul>
                                    <li> <b> <h5> Tools </h5> </b> </li>
                                        <ul>
                                            <li>C++</li>
                                        </ul>
                                    <li> <b> <h5> Domain </h5> </b> </li>
                                        <ul>
                                            <li>C++</li>
                                        </ul>
                                    <li> <b> <h5> Exerience </h5> </b> </li>
                                        <ul>
                                            <li>C++</li>
                                        </ul>
                                </ul>
                            </div>
                            <div className="col">
                                <ul type="none">
                                    <li> <b> <h5> Project Title </h5> </b> </li>
                                        <ul>
                                            <li> Lorem ipsum dolor sit amet consectetur adipisicing elit. Soluta porro similique eligendi minus recusandae, deleniti quaerat aut officiis commodi veritatis magnam odio, unde natus omnis assumenda explicabo amet molestiae error?  </li>
                                        </ul>
                                </ul>
                            </div>
                            
                        </div>
                    </div>
                </div>
                
            </form>
            
        )
    }
}
